INSERT INTO `articles` VALUES (1,'材料基因组工程研究院张统一院士一行赴鄂尔多斯集团访问调研',' 张明','日前，我校材料基因组工程研究院张统一院士率团一行9人赴鄂尔多斯集团公司进行了实地调研考察，并出席“上海大学-鄂尔多斯电冶集团新材料学术研讨会”。在三天的调研考察和学术交流活动中，调研组一行分别实地考察了鄂尔多斯控股集团旗下的数个企业和厂区，如锰系铁合金公司、硅铁四分厂、余热发电项目、电力三公司、电石二公司、PVC公司、化学工业公司及羊绒产业基地等八家企业，集团及企业负责人就各公司的工艺流程、生产经营情况、技术难题等方面向我校调研组进行了现场汇报咨询。','http://static.dev.ncg.yayanosite.com/images/zatf3quqf3onipb9160823223916.png',1,'标签,测试','<div><font color=\"#666666\" face=\"宋体\"><span style=\"font-size: 16px; line-height: 30px;\">日前，我校材料基因组工程研究院张统一院士率团一行9人赴鄂尔多斯集团公司进行了实地调研考察，并出席“上海大学-鄂尔多斯电冶集团新材料学术研讨会”。在三天的调研考察和学术交流活动中，调研组一行分别实地考察了鄂尔多斯控股集团旗下的数个企业和厂区，如锰系铁合金公司、硅铁四分厂、余热发电项目、电力三公司、电石二公司、PVC公司、化学工业公司及羊绒产业基地等八家企业，集团及企业负责人就各公司的工艺流程、生产经营情况、技术难题等方面向我校调研组进行了现场汇报咨询。在考察期间，在鄂尔多斯集团公司下属电冶集团举办了“上海大学-鄂尔多斯电冶集团新材料学术研讨会”，控股集团副总裁、电冶集团总经理张奕龄介绍了园区技术领域的基本情况，期望双方建立常态性的技术交流与沟通，请上海大学材料基因组工程研究院专家学者为解决鄂尔多斯公司技术难题和发展出谋献策。我校调研小组成员分别就调研中发现的技术难题提出了可行性意见，与参会人员达成了解决技术难点的意向和共识。</span></font></div><div><font color=\"#666666\" face=\"宋体\"><span style=\"font-size: 16px; line-height: 30px;\">本次的实地调研是基于双方在今年4月签署的战略合作协议并成立的“上海大学-鄂尔多斯先进材料联合研究开发中心”而应鄂尔多斯集团公司的邀请亲赴企业一线进行考察的。会上，张统一院士对双方共建的“上海大学-鄂尔多斯先进材料联合研究开发中心”运作表示满意，他希望双方共同努力，利用研究院的智力资源和一流研发能力、先进的基地平台、完善的数据库资源来支撑鄂尔多斯集团的产业需求，在新材料、新能源、环保、化工和冶金等领域开展密切合作，提升企业的科技创新能力和水平，达到服务社会、开展产学研合作，实现合作共赢的目标。</span></font></div><div><font color=\"#666666\" face=\"宋体\"><span style=\"font-size: 16px; line-height: 30px;\">调研交流过程中，鄂尔多斯集团高层领导提出了在我校设立“鄂尔多斯材料基因组奖学金”的提议，目前已进入方案完善阶段。并在部分急需技术改造和提升研发项目上形成了15个技术开发意向，也提出了对企业技术人员开展技术培训等方面的合作意向。整个访问交流热烈、日程紧张、成果丰硕，取到了很好的效果。</span></font></div>',0,'2016-08-23 14:39:51'),(2,'中信特钢研究院暨上海大学分院合作项目汇报会召开','关艳芳','8月15日下午，中信特钢研究院暨上海大学分院合作项目汇报会在上海大学国际会议中心举行。第十届全国政协副主席、中国工程院主席团名誉主席、中国金属学会理事长徐匡迪院士，中国工程院刘玠院士、李鹤林院士、潘健生院士，上海大学校长金东寒院士、副校长汪敏，中信泰富特钢集团董事长俞亚鹏、总裁钱刚，上海大学材料学院院长董瀚、省部共建特殊钢冶金与制备国家重点实验室主任任忠鸣及实验室科研人员、中信泰富特钢集团有关企业领导参加了会议。','/assets/img/cover/default.png',2,'标签','<p style=\"padding: 0px; margin-bottom: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); text-indent: 21pt; background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">徐匡迪院士在讲话中强调，特殊钢智能制造是创新发展的重要方向，是颠覆性的技术，需要更加关注并为之努力。在人才培养上，企业与院校要发挥各自的优势和功能，强化全方面的合作，建设好项目团队，推进好项目对接。此外，要利用好“契约”的手段和方法，使双方合作取得更大的成绩。</span></p><p style=\"padding: 0px; margin-bottom: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); text-indent: 21pt; background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">金东寒校长表示，非常支持院校与企业的技术合作，优秀的科研成果应该在企业得到全面应用和推广，不断提升产品附加值。上海大学希望与中信泰富特钢集团建立长期合作关系，校企联合实现资源共享，共谋未来发展。</span></p><p style=\"padding: 0px; margin-bottom: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); text-indent: 21pt; background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">俞亚鹏董事长感谢徐匡迪院士、与会院士以及上海大学领导、教授对中信泰富特钢集团的关心和支持。目前，集团与上海大学的合作已经取得了可喜的成果，解决了一些企业创新发展中的技术难题。双方要坚持把研究和应用相结合，根据市场需求来开展项目，建立长期紧密的战略合作，同时要深化知识产权保护工作，促使双方合作能够更加健康有序的发展。</span></p><p style=\"padding: 0px; margin-bottom: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); text-indent: 21pt; background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">会议听取了中信特钢研究院科研项目进展、研究院上大分院主要科研工作情况汇报，就下一阶段中信泰富特钢集团与上海大学合作计划与安排征求了与会领导与专家的意见。会上专家们畅所欲言，对中信特钢研究院今后的发展提出了许多有建设性的建议。　</span></p>',0,'2016-08-24 15:10:10'),(3,'罗宏杰书记率团访问以色列','戎艳','8月2日至6日，为协商建立上海大学与以色列著名高校之间的合作关系，校党委书记罗宏杰率团对以色列希伯来大学、魏兹曼研究所、特拉维夫大学、以色列理工学院等著名高校和研究机构进行了友好访问。','http://static.dev.ncg.yayanosite.com/images/vph8ecmfgnhoajor160824002629.png',3,'DVA爱你哦','<p style=\"padding: 0px; margin-bottom: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); text-indent: 21pt; background-color: rgb(246, 246, 246);\">8<span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">月</span>2<span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">日，代表团访问了以色列排名第一的希伯来大学，该校中国战略合作项目校长特使</span>Rafi Aviram<span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">、外事处处长</span>Jane Turner<span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">、计算机学院院长</span>Shmuel Peleg<span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">等接待了代表团。双方就可能的合作方式以及合作领域展开了深入交流，经过讨论，双方同意围绕人工智能研究领域的科学研究、研究生联合培养以及技术成果转移等方面启动合作，并探讨建立联合研究机构的可能性。在成功合作基础上，进一步探讨在与希伯来大学其他强势领域开展合作的可能性以及合作形式。</span>&nbsp;</p><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img border=\"0\" alt=\"\" src=\"http://tougao.shu.edu.cn/UploadFile/Portals/NEW/6/2016-8/3533/1.jpg\" width=\"600\" longdesc=\"http://news.shu.edu.cn/Default.aspx?tabid=449&amp;ctl=Details&amp;mid=1059&amp;ItemID=35523&amp;SkinSrc=[L]Skins/SHUnews_o/SHUnews_1\" height=\"400\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; border-width: initial; border-style: none;\"></div>&nbsp;</div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8</span><span style=\"padding: 0px; margin: 0px;\">月</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">3</span><span style=\"padding: 0px; margin: 0px;\">日，代表团访问了特拉维夫大学，该校副校长</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Raanan Rein</span><span style=\"padding: 0px; margin: 0px;\">、亚洲学术交流与商务发展部主任</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">/</span><span style=\"padding: 0px; margin: 0px;\">校长顾问</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Orlyf Fromer</span><span style=\"padding: 0px; margin: 0px;\">等接待了代表团。</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Raanan Rein</span><span style=\"padding: 0px; margin: 0px;\">副校长介绍说，他们有较好的中国大陆合作意愿及合作基础，与大陆若干高校已经有一定合作，他们已经形成了较为常态化的中国大陆合作机制，希望推进与上海大学的合作，并希望在</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">2017</span><span style=\"padding: 0px; margin: 0px;\">年初，双方在上海大学举行科研合作论坛，建立双方教授之间的联系与合作，并进一步探讨建立联合研究机构的可能性。</span></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img border=\"0\" alt=\"\" src=\"http://tougao.shu.edu.cn/UploadFile/Portals/NEW/6/2016-8/3533/2.jpg\" width=\"600\" longdesc=\"http://news.shu.edu.cn/Default.aspx?tabid=449&amp;ctl=Details&amp;mid=1059&amp;ItemID=35523&amp;SkinSrc=[L]Skins/SHUnews_o/SHUnews_1\" height=\"400\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; border-width: initial; border-style: none;\"></div></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8</span><span style=\"padding: 0px; margin: 0px;\">月</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">4</span><span style=\"padding: 0px; margin: 0px;\">日上午，代表团访问了魏兹曼研究所，魏兹曼研究所副所长</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Michal Neeman</span><span style=\"padding: 0px; margin: 0px;\">接待了代表团，她介绍说，魏兹曼研究所主要开展基础理论原创性研究，国际合作成为科学研究的常态，</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">60%</span><span style=\"padding: 0px; margin: 0px;\">以上的论文都是国际合作发表，他们通过将成果</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">IP</span><span style=\"padding: 0px; margin: 0px;\">出售给企业获得科研资金。他们为教授提供世界一流的科研环境和机制，教授们有最大的学术研究自由，对外合作都是从教授们开始并由他们来推动。</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Michal Neeman</span><span style=\"padding: 0px; margin: 0px;\">副所长同意双方加强教授之间的交流与合作，并在此基础上探讨双方共建联合实验室的可能性。</span></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img border=\"0\" alt=\"\" src=\"http://tougao.shu.edu.cn/UploadFile/Portals/NEW/6/2016-8/3533/3.jpg\" width=\"600\" longdesc=\"http://news.shu.edu.cn/Default.aspx?tabid=449&amp;ctl=Details&amp;mid=1059&amp;ItemID=35523&amp;SkinSrc=[L]Skins/SHUnews_o/SHUnews_1\" height=\"400\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; border-width: initial; border-style: none;\"></div><div style=\"padding: 0px; margin: 0px;\"></div></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">8</span><span style=\"padding: 0px; margin: 0px;\">月</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">4</span><span style=\"padding: 0px; margin: 0px;\">日下午，代表团拜访了位于以色列海法的以色列理工学院，该校副校长</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Paul D. Feigin</span><span style=\"padding: 0px; margin: 0px;\">以及国际交流处、科技处、学生事务处、科创及企业中心等部门负责人参加了接待并分别进行了交流。</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Paul D. Feigin</span><span style=\"padding: 0px; margin: 0px;\">副校长介绍说，他们与美国康内尔大学在纽约建立了分校，目前在李嘉诚先生支持下开展了与中国汕头大学的合作，与汕头大学合作的联合学院将于</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">2017</span><span style=\"padding: 0px; margin: 0px;\">年正式招生。双方探讨了博士生的联合培养以及青年教师的交流，将进一步商讨“博士生</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">+</span><span style=\"padding: 0px; margin: 0px;\">博士后”的合作培养计划。</span></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img border=\"0\" alt=\"\" src=\"http://tougao.shu.edu.cn/UploadFile/Portals/NEW/6/2016-8/3533/4.jpg\" width=\"600\" longdesc=\"http://news.shu.edu.cn/Default.aspx?tabid=449&amp;ctl=Details&amp;mid=1059&amp;ItemID=35523&amp;SkinSrc=[L]Skins/SHUnews_o/SHUnews_1\" height=\"400\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; border-width: initial; border-style: none;\"></div></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 代表团访以期间，还拜访了以色列知名创新咨询公司</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">SIT</span><span style=\"padding: 0px; margin: 0px;\">，会见了公司总裁</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Amnon Levav</span><span style=\"padding: 0px; margin: 0px;\">和副总裁</span><span lang=\"EN-US\" style=\"padding: 0px; margin: 0px;\">Nurit Shalev</span><span style=\"padding: 0px; margin: 0px;\">。听取了他们对以色列创新内涵、企业创新管理理念和机制介绍。</span><span style=\"padding: 0px; margin: 0px;\"></span></div><div style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img border=\"0\" alt=\"\" src=\"http://tougao.shu.edu.cn/UploadFile/Portals/NEW/6/2016-8/3533/5.jpg\" width=\"600\" longdesc=\"http://news.shu.edu.cn/Default.aspx?tabid=449&amp;ctl=Details&amp;mid=1059&amp;ItemID=35523&amp;SkinSrc=[L]Skins/SHUnews_o/SHUnews_1\" height=\"400\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; border-width: initial; border-style: none;\"></div><div style=\"padding: 0px; margin: 0px;\">&nbsp;</div><div style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 国际事务处处长万旺根、计算机工程与科学学院院长郭毅可、通信与信息工程学院党委书记黄素娟、机电工程与自动化学院党委书记刘亮陪同访问。&nbsp;</div></div><div align=\"right\" style=\"padding: 0px; margin: 0px; font-family: 微软雅黑; line-height: 30px; color: rgb(102, 102, 102); background-color: rgb(246, 246, 246);\"><span style=\"padding: 0px; margin: 0px;\">国际事务处供稿</span></div>',0,'2016-08-23 16:27:00');
